import React from "react";
import "../SimpleComponents/ListItem.css";
import { StickyContainer, Sticky } from "react-sticky";

function NavBar() {
  return (
    <StickyContainer>
      <Sticky>
        {({ style }) => (
          <nav className="navbar navbar-dark bg-dark">
            <span className="navbar-brand mb-0 h6">The DC Comic Hero List</span>
          </nav>
        )}
      </Sticky>
    </StickyContainer>
  );
}

export default NavBar;
